import React, { useState } from 'react';
import { Link, useParams } from 'react-router-dom';

function MyInfoPage() {
  const { userid } = useParams();
  
  const [userInfo, setUserInfo] = useState({
    name: "학술제",
    username: "cdflavor1113",
    password: "************",
    birthdate: "2000-11-13",
    email: "cdflavor1113@naver.com",
    phone: "010-1113-1114"
  });

  // // 사용자 정보 업데이트 함수
  // const updateUserInfo = () => {
  //   // userInfo 상태 업데이트를 통해 UI가 자동으로 업데이트됩니다.
  // }

  // 로그아웃 함수
  const logout = () => {
    // 로그아웃 확인 팝업
    const confirmLogout = window.confirm("정말로 로그아웃 하시겠습니까?");
    if (confirmLogout) {
      // 로그아웃 처리
      alert("로그아웃 되었습니다.");
    }
  }

  // 회원탈퇴 함수
  const withdraw = () => {
    // 회원탈퇴 확인 팝업
    const confirmWithdraw = window.confirm("정말로 회원탈퇴 하시겠습니까?");
    if (confirmWithdraw) {
      // 회원탈퇴 처리
      alert("회원탈퇴 되었습니다.");
    }
  }

  return (
    <div>
      <style>
      {`
      body {
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 20px;
      }

      .flavor_logo {
        left: 10px;
      }
      
      h1 {
        text-align: center;
        margin-bottom: 20px;
      }
      
      table {
        margin-left: 10%;
        width: 80%;
        border-collapse: collapse;
      }
      
      th, td {
        padding: 10px;
        text-align: left;
      }
      
      th {
        background-color: #f2f2f2;
      }
      
      .button-container {
        text-align: center;
        margin-top: 20px;
      }
      
      .button-container button {
        margin: 10px;
        padding: 8px 16px;
        font-size: 14px;
        border: none;
        border-radius: 4px;
        cursor: pointer;
      }
      
      .button-container button.logout {
        background-color: #ffa99a;
        color: #fff;
      }
      
      .button-container button.withdraw {
        background-color: #ad9e98;
        color: #fff;
      }
      `}
      </style>
      <Link to="/">
        <button type="flavor_logo" className="flavor_logo">
          <img src="https://img1.daumcdn.net/thumb/R1280x0/?scode=mtistory2&fname=https%3A%2F%2Fblog.kakaocdn.net%2Fdn%2FNCkp7%2Fbtshz0iU8wZ%2FGdartd1kgTj0ZXMhJ0IKwk%2Fimg.png" width="300" height="105" alt="flavor_logo" />
        </button>
      </Link>
      <h1>내 정보</h1>
      <table>
        <thead>
          <tr>
            <th>항목</th>
            <th>내용</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>이름</td>
            <td id="name">{userInfo.name}</td>
          </tr>
          <tr>
            <td>아이디</td>
            <td id="username">{userInfo.username}</td>
          </tr>
          <tr>
            <td>비밀번호</td>
            <td id="password">{userInfo.password}</td>
          </tr>
          <tr>
            <td>생년월일</td>
            <td id="birthdate">{userInfo.birthdate}</td>
          </tr>
          <tr>
            <td>이메일</td>
            <td id="email">{userInfo.email}</td>
          </tr>
          <tr>
            <td>전화번호</td>
            <td id="phone">{userInfo.phone}</td>
          </tr>
        </tbody>
      </table>
      <div className="button-container">
        <button className="logout" onClick={logout}>로그아웃</button>
        <button className="withdraw" onClick={withdraw}>회원탈퇴</button>
      </div>
    </div>
  );
}

export default MyInfoPage;
